export const actionTypes = {
    GET_ALL_EXAMINATIONCALENDAR_REQUEST: 'GET_ALL_EXAMINATIONCALENDAR_REQUEST',
    GET_ALL_EXAMINATIONCALENDAR_SUCCESS: 'GET_ALL_EXAMINATIONCALENDAR_SUCCESS',
    GET_INACTIVE_EXAMINATIONCALENDAR_REQUEST: 'GET_INACTIVE_EXAMINATIONCALENDAR_REQUEST',
    GET_INACTIVE_EXAMINATIONCALENDAR_SUCCESS: 'GET_INACTIVE_EXAMINATIONCALENDAR_SUCCESS'
};

export function getAllQBankSubCategory(payload) {
    return { type: actionTypes.GET_ALL_EXAMINATIONCALENDAR_REQUEST, payload };
}

export function getAllQBankSubCategorySuccess(payload) {
    return { type: actionTypes.GET_ALL_EXAMINATIONCALENDAR_SUCCESS, payload };
}

export function getInactiveQBankSubCategory(payload) {
    return { type: actionTypes.GET_INACTIVE_EXAMINATIONCALENDAR_REQUEST, payload };
}

export function getInactiveQBankSubCategorySuccess(payload) {
    return { type: actionTypes.GET_INACTIVE_EXAMINATIONCALENDAR_SUCCESS, payload };
}
